import { Link } from "react-router-dom";

const ProjectCard = ({ name, id, img, date, description }) => {
    return (
        <div className="project" id={id}>
            <Link className="project-link">
                <img src={require(img)} />
                <h2>
                    {name}
                </h2>
                <h3>
                    {date}
                </h3>
                <p>
                    {description}
                </p>
            </Link>
        </div>
    )
}

export default ProjectCard;
